import React from 'react';
import './SearchResults.css';


class SearchResults extends React.Component{
  constructor(props){
      super(props);
      this.state = {
          searchResults: []
      }
  }

    componentDidMount(){
        fetch('http://hn.algolia.com/api/v1/items/1', {method: 'GET'},)
        .then(res => res.json())
        .then(data => this.setState({searchResults: data.children}));
    }
    render(){    
       return
    }
}


export default SearchResults;
